import axios from 'axios';
import './App.css';
const API_URL = 'http://localhost:8080/'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        { axios.get(API_URL = 'http://localhost:8080/') }
      </header>
    </div>
  );
}

export default App;
